sc_cat_item_producer.script:
if (current.u_dc_location.name == "San Antonio")
    {
current.short_description =  current.u_visitor_firstname + " " + current.u_visitor_lastname + " From " + current.company.name  + " Visiting San Antonio Datacenter";		
}
    else
        {
current.short_description =  current.u_visitor_firstname + " " + current.u_visitor_lastname + " From " + current.company.name  + " Visiting Winston Salem Datacenter";
}
